INSERT INTO `opesc_product_description` VALUES (421, 2, 'Produto modelo', '&lt;p style=&quot;box-sizing: inherit; margin-bottom: 1rem; padding: 0px; font-size: 16px; line-height: 1.6; text-rendering: optimizelegibility; color: rgb(40, 40, 40); font-family: Glegoo, serif; font-weight: 700;&quot;&gt;Mussum Ipsum, cacilds vidis litro abertis. Quem num gosta di mim que vai caçá sua turmis! Per aumento de cachacis, eu reclamis. Praesent malesuada urna nisi, quis volutpat erat hendrerit non. Nam vulputate dapibus. Quem num gosta di mé, boa gentis num é.&lt;/p&gt;&lt;p style=&quot;box-sizing: inherit; margin-bottom: 1rem; padding: 0px; font-size: 16px; line-height: 1.6; text-rendering: optimizelegibility; color: rgb(40, 40, 40); font-family: Glegoo, serif; font-weight: 700;&quot;&gt;Leite de capivaris, leite de mula manquis sem cabeça. Suco de cevadiss, é um leite divinis, qui tem lupuliz, matis, aguis e fermentis. Posuere libero varius. Nullam a nisl ut ante blandit hendrerit. Aenean sit amet nisi. Atirei o pau no gatis, per gatis num morreus.&lt;/p&gt;', '', '', '', '');
